import { Typography } from 'antd';
import { Layout } from "antd";

const { Title } = Typography;
const { Header, Footer, Sider, Content } = Layout;

const HomePage = () => {
  return (
    <Layout>
      <Content>
         <div>
           <Title>Tianjian (Frost) Xu</Title>
         </div>
      </Content>
    </Layout>
  );
};

export default HomePage;
